import React from 'react';
import { withRouter } from 'react-router-dom';

function Cart(props) {
    return (
        <div>
            <table>
                <tr>
                    <td></td>
                    <td>상품명</td>
                    <td>수량</td>
                    <td>옵션</td>
                </tr>
            </table>
        </div>
    )
}


export default withRouter(Cart);
